  true,\n\t\"url\": null,\n\t\"notes\": \"Eddy fluxes of CO2 and H2O are measured
  at two levels (58m and 47m) using tower-mounted closed-path Licor 6262 analyzers
  and Campbell CSAT3 sonic anemometers.  A third Licor gas analyzer measures (a) the
  CO2/H2O concentration profile (1 of 8 levels every 2 minutes) and (b) the instantaneous
  integrated canopy storage of CO2/H2O, using a design pulling air simultaneously
  through 8 inlets (once every 20 minutes). Comprehensive meteorological data (air
  temperature, PAR, net radiation, etc) are also included.  Pressure and temperature
  of the Licor cells are controlled to 500 torr and 48 degrees C.  Eddy licors are
  automatically zeroed every 2 hours and the profile licor every 20 minutes.  All
  Licors are automatically calibrated with span gases (at 325, 400, and 475 ppm) every
  6 hours.\",\n\t\"owner_org\": \"d8a6202b-c0c3-463d-88a0-3bc021a178ed\",\n\t\"extras\":
